css:
 {
  align-items: flex-start;
  align-self: stretch;
  min-height: 276px;
  max-height: 80vh;
  overflow: hidden;
}

align-items: center;
align-self: stretch;
display: flex;
gap: var(--rosetta-size-spacing-four);
padding: var(--rosetta-size-spacing-eight) var(--rosetta-size-spacing-eight)
  var(--rosetta-size-spacing-three) var(--rosetta-size-spacing-eight);

h1 {
  font-size: var(--rosetta-size-font-fs5);
  flex: 1 0 0;
}

display: flex;
flex-direction: column;
flex: 1;
line-height: var(--rosetta-size-lineHeight-lh6);
margin: 0;
text-align: justify;
padding: var(--rosetta-size-spacing-two) var(--rosetta-size-spacing-eight) 0
  var(--rosetta-size-spacing-eight);
overflow: hidden;

p {
  margin: 0;
}

display: grid;
grid-template-columns: repeat(2, 1fr);
grid-auto-rows: min-content;
gap: var(--rosetta-size-spacing-three) 0;
list-style: none;
padding: 0;
margin-top: var(--rosetta-size-spacing-four);
min-height: 150px;
max-height: 293px;
height: calc(55vh - 235px);
overflow-y: auto;
li {
  display: flex;
}

white-space: nowrap;
overflow: hidden;
text-overflow: ellipsis;
width: 180px;

align-items: center;
flex-shrink: 0;
gap: var(--rosetta-size-spacing-three);
justify-content: flex-end;
padding: 0 var(--rosetta-size-spacing-eight) var(--rosetta-size-spacing-eight)
  var(--rosetta-size-spacing-eight);
position: sticky;
bottom: 0;
background: var(--rosetta-bg-primary);
width: 100%;
box-sizing: border-box;

.editor-wrapper {
  width: 100%;
}

.rich-text-editor {
  max-height: 200px;
}

font-size: 12px;
line-height: 15px;
white-space: nowrap;
overflow: hidden;
text-overflow: ellipsis;
width: 180px;

display: flex;
align-items: center;
gap: var(--rosetta-size-spacing-two);
